import logo from "./logo.svg";
import "./App.css";

function App() {
  var details = "I'm a react person";
  var object = {
    name: "Asrhaf Uzzaman",
    occopation: "Web",
  };
  var style = {
    color: "yellow",
    listStyle: "none",
    fontWeight: "bold",
    fontSize: 28,
    fontFamily: "arial",
    textTransform: "uppercase",
  };

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>{details}</p>
        <ul style={style}>
          <li>{object.name}</li>
          <li>{object.occopation}</li>
        </ul>
        <span>My total math total number is {(5 + 5) * 9}</span>
        <Person></Person>
      </header>
    </div>
  );
}

function Person() {
  return (
    <div style={{ border: "1px solid yellow", color: "red" }}>
      <h1>Sakib Al Hasan</h1>
      <h3>Cricketer</h3>
    </div>
  );
}

export default App;
